var _weapondesc = {
    "23048": "<i>「千年后，历史将如何铭记刻律德菈？」</i><br>她曾如此被人问道。<br><br>有人心中，她是赫赫威名的「凯撒」。<br>那冰冷残酷的暴君，那野心勃勃的「燃冕者」，那以血与火烧尽旧时代的女皇……<br><br>有人反驳，她只是一枚可怜的「棋子」。<br>这众叛亲离的君王不过是野心的囚徒，在那场与神明对决的棋局中，她注定只能满盘皆输。<br><br>也有人说，在那比海更幽暗的内心深处，她只是一个名为「刻律德菈」的凡人——<br>她也会为死难的同伴哀悼，也会在沉重的使命前犹疑畏惧，止步不前……<br><br><i>「呵，无需历史将我铭记……」</i><br><br>她咽下心头苦涩，继续行在那由牺牲铺就的逐火之路——<br><br><i>「是吾等燃烧的金血，铭刻了它！」</i>",
    "23047": "浪花奔涌，涛声响彻天际。<br>鱼儿洄游在那空无一物的海，旧日的泡沫翻腾，那一曲乐声似乎仍在回荡。<br><br><i>「尊贵的公主，与我们共飨盛宴吧！」</i><br>为了回应这深海的呼唤，她随那黑潮起舞，直至盛大的舞台上只剩她一人。<br><br><i>「海洋的剑士，你为何沉默，为何而歌？」</i><br>行于大地的每一步，她忍受痛苦，鲜少歌唱，只有那血色的锋刃奏出生命的悲鸣。<br><br><i>「剑旗爵，随我一同，征服星海！」</i><br>当她寻到这炙热的灯火，她终于执起琴弓，以为那就是欢宴的开始。<br><br>……<br><br><i>「海列屈拉…海列屈拉…一曲唱毕，你还要游向哪里？」</i><br><br>当虚妄的希望碎裂，她总是以一曲孤独的旋律回答人们的诘问，却使所有听者心醉魂迷——<br><br>又或许…无论在人世或深海， 真正能听到的，唯有奏者自己。",
    "22005": "轰隆隆——<br>迷境之外，风雨无休无止。<br>咕噜噜——<br>妖精们的神奇大煮锅，火焰不熄。<br><br><i>「撒上特制香料……」</i><br><i>「放入新鲜的蔬菜！」</i><br><i>「这一次，一定能研发成功！」</i><br><br>大煮锅又咕噜噜了起来，妖精们眼巴巴地望着。<br><i>「要来了要来了！」</i><br>一束强烈的亮光自锅底生出——<br><br>看，大家都围了过来！<br><br>……<br><br>在那香气四溢的宴会上，来客举杯共祝奇妙的岁月——<br><br>愿这梦中的乐土，永远温暖，永远欢乐！"
}

